using ModifyGraphEdgeWeights;

namespace ModifyGraphEdgeWeightsTest
{
    [TestClass]
    public class UnitTest1
    {
        [TestMethod]
        public void TestMethod1()
        {
            Solution solution = new Solution();
            var result = solution.ModifiedGraphEdges(5, new int[][]
            {
                new int[]{4, 1, -1 }
                ,new int[]{2, 0, -1 }
                ,new int[]{0, 3, -1 }
                ,new int[]{4, 3, -1 }
            }, 0, 1 , 5);

            CollectionAssert.AreNotEquivalent(result, new int[][] { });
        }

        [TestMethod]
        public void TestMethod2()
        {
            Solution solution = new Solution();
            var result = solution.ModifiedGraphEdges(5, new int[][]
            {
                new int[]{4, 1, -1 }
                ,new int[]{2, 0, -1 }
                ,new int[]{0, 3, -1 }
                ,new int[]{4, 3, -1 }
            }, 2, 1, 5);

            CollectionAssert.AreNotEquivalent(result, new int[][] { });
        }

        [TestMethod]
        public void TestMethod3()
        {
            Solution solution = new Solution();
            
            var result = solution.ModifiedGraphEdges(5, new int[][]
            {
                new int[]{4, 1, -1 }
                ,new int[]{2, 0, -1 }
                ,new int[]{0, 3, -1 }
                ,new int[]{4, 3, 3 }
            }, 2, 1, 5);

            CollectionAssert.AreEquivalent(result, new int[][] { });
        }

        [TestMethod]
        public void TestMethod4()
        {
            Solution solution = new Solution();

            var result = solution.ModifiedGraphEdges(5, new int[][]
            {
                new int[]{4, 1, -1 }
                ,new int[]{2, 0, -1 }
                ,new int[]{0, 3, -1 }
                ,new int[]{4, 3, 3 }
                , new int []{ 1,2,10}
            }, 2, 1, 5);

            CollectionAssert.AreEquivalent(result, new int[][] { });
        }

        [TestMethod]
        public void TestMethod5()
        {
            Solution solution = new Solution();

            var result = solution.ModifiedGraphEdges(5, new int[][]
            {
                new int[]{4, 1, -1 }
                ,new int[]{2, 0, 3 }
                ,new int[]{0, 3, -1 }
                ,new int[]{4, 3, -1 }
                , new int []{ 1,2,10}
                , new int []{ 3,2,3}
            }, 2, 1, 5);

            CollectionAssert.AreNotEquivalent(result, new int[][] { });
        }

        /*
            Input: n = 3, edges = [[0,1,-1],[0,2,5]], source = 0, destination = 2, target = 6
            Output: []
            Explanation: The graph above contains the initial edges. It is not possible to make 
            the distance from 0 to 2 equal to 6 by modifying the edge with weight -1. 
            So, an empty array is returned.
         */

        [TestMethod]
        public void TestMethod6()
        {
            Solution solution = new Solution();

            var result = solution.ModifiedGraphEdges(3, new int[][]
            {
                new int[]{ 0, 1, -1 }
                ,new int[]{ 0, 2, 5 }

            }, 0, 2, 6);

            CollectionAssert.AreEquivalent(result, new int[][] { });
        }

        [TestMethod]
        public void TestMethod7()
        {
            Solution solution = new Solution();

            var result = solution.ModifiedGraphEdges(3, new int[][]
            {
                new int[]{ 0, 1, -1 }
                ,new int[]{ 0, 2, 5 }

            }, 1, 2, 6);

            CollectionAssert.AreNotEquivalent(result, new int[][] { });
        }

        /*
         Input: n = 4, edges = [[1,0,4],[1,2,3],[2,3,5],[0,3,-1]], source = 0, destination = 2, target = 6
Output: [[1,0,4],[1,2,3],[2,3,5],[0,3,1]]
Explanation: The graph above shows a modified graph having the shortest distance from 0 to 2 as 6.
         */
        [TestMethod]
        public void TestMethod8()
        {
            Solution solution = new Solution();

            var result = solution.ModifiedGraphEdges(4, new int[][]
            {
                new int[]{ 1, 0, 4 }
                ,new int[]{ 1, 2, 3 }
                ,new int[]{ 2, 3, 5 }
                ,new int[]{ 0, 3, -1 }

            }, 0, 2, 6);

            CollectionAssert.AreNotEquivalent(result, new int[][] { });
        }

